INSERT INTO `table_professor` VALUES (0,'Regis Rossi Alves Faria',NULL,NULL,'357H – Edifício I1','regis@usp.br','Rossi',0,0,' ','ACH2167, ACH2207','Favor desconsiderar formulário anterior enviado incompleto. Sem seleção de disciplinas para 1o Semestre 2023 em função da licença prêmio programada para este semestre. Sexta-feira é o dia que não gostaria de ministrar aula no 2o semestre.','O dia e horário para participar das reuniões da CCEx ainda não está definido para 2o semestre ainda, o que pode mudar a condição de dia e período de impedimento referente ao item 4 acima.',1),(1189627,'Edmir Parada Vasques Prado',NULL,NULL,'110M – Edifício A1','eprado@usp.br','Edmir',4,0,'Licença prêmio no segundo semestre de 2023','ACH2078','Gostaria que as disciplinas fossem alocadas em dois dias consecutivos, pois não resido em São Paulo',NULL,1),(1234567,'José de Jesus Pérez Alcázar',1568762,NULL,'352-F','jperez@usp.br','J. Perez',0,0,NULL,'ACH2078 - Gestão Empresarial',NULL,NULL,1),(1290945,'Camilo Rodrigues Neto',NULL,NULL,'322-O – Edifício I1','camiloneto@usp.br','C.Rodrigues',0,0,NULL,'ACH2138','semestre 1: gostaria de 2 turmas de TADI no mesmo dia, em horários consecutivos (no mesmo período, na terça, quarta ou quinta) \nsemestre 2: gostaria de 1 turma de ACH2138 na terça, quarta ou quinta','Por favor, gostaria de 4 horas contíguas na graduação (e.g., 2 turmas de TADI), terça, quarta ou quinta, à tarde ou à noite. Também ministrarei uma disciplina da pós.',1),(1339463,'Valdinei Freire da Silva',NULL,NULL,'110O – Edifício A1','valdinei.freire@usp.br','Valdinei',4,0,NULL,'ACH2137, ACH2076',NULL,NULL,1),(1748128,'Helton Hideraldo Bíscaro',NULL,NULL,'252 -352B – Prédio I1','heltonhb@usp.br','Helton',0,2,NULL,NULL,NULL,NULL,1),(1966487,'Fernando Auil',NULL,NULL,'357 F – Prédio I1','auil@usp.br','Auil',0,0,NULL,NULL,NULL,NULL,1),(2135425,'Karla Roberta Pereira Sampaio Lima',NULL,NULL,'104P – Edifício A1','ksampaiolima@usp.br','K.Lima',0,0,NULL,NULL,'Gostaria de dar aula pela manhã, meus filhos a partir do semestre que vem entrarão muito cedo na escola.',NULL,1),(2159931,'Masayuki Oka Hase',NULL,NULL,'202A – Edifício I1','202A – Edifício I1','Masayuki',0,0,NULL,'ACH2128','Preferência em NÃO ministrar TADI (ACH0021) & Preferência pelas aulas noturnas',NULL,1),(2359716,'Esteban Fernandez Tuesta',NULL,NULL,'346-E – Bloco I1','tuesta@usp.br','Esteban',0,0,NULL,NULL,'Gostaria de ministrar as disciplinas no período diurno.',NULL,1),(2415676,'Marcio Moretto Ribeiro',NULL,NULL,'244','marciomr@usp.br','Moretto',0,0,NULL,NULL,NULL,NULL,0),(2536844,'Norton Trevisan Roman',NULL,NULL,'110R – Edifício A1','norton@usp.br','Norton',4,0,NULL,'ACH2118, ACH2177','Peço que as aulas sejam alocadas em , no máximo, dois dias distintos.','Peço que minhas turmas se concentrem em, no máximo, 2 dias da semana.',1),(2617864,'Flávio Luiz Coutinho',NULL,NULL,'323','flcoutinho@usp.br','Flávio',0,4,NULL,'ACH2117, ACH2157',NULL,NULL,1),(2730928,'Fábio Nakano',NULL,NULL,'A1-204E','fabionakano@usp.br','F. Nakano',0,0,'Não pretendo.','ACH2157-Computação física.',NULL,'Em princípio, serão as mesmas disciplinas de 2022-2.\nA alocação feita no ano passado - terças e sextas - me satisfaz muito. \nAtt.\nFábio.\n',1),(2842009,'Clodoaldo Aparecido de Moraes Lima',NULL,NULL,'104N – Prédio A1','c.lima@usp.br','Clodoaldo',0,0,'Pretendo solicitar licença premio para 2o Semestre de 2023 ','ACH2177 - Introdução à Ciências de Dados, ACH2187 - Mineração de dados','No 1o Semestre irei lecionar a disciplina Aprendizado de Máquina no PPgSI',NULL,1),(2877477,'Gisele da Silva Craveiro',NULL,NULL,'252 – Edifício I1','giselesc@usp.br','Gisele',0,0,NULL,'Governo Aberto  (de preferencia duas turmas)',NULL,NULL,1),(2971654,'Ivandré Paraboni',NULL,NULL,'320F – Edifício I1','ivandre@usp.br','Ivandré',2,0,NULL,'ACH2118',NULL,'Não tenho nenhum impedimento além do indicado, mas gostaria de sugerir à CoC-SI que considerasse algum tipo de revezamento entre os docentes disponíveis no horário noturno de sexta-feira, pois esse é o momento da semana em que todos (docentes e discentes) estão mais cansados e no qual, ao meu ver, o trabalho é mais difícil. Grato pela atenção.',1),(2984179,'André Carlos Busanelli de Aquino',NULL,NULL,'64','aquino@usp.br','A.Aquino',4,0,'Projeto senior PRINT Politécnico Milano aprovado para Março/23-Ago/23. Acordo realizado com Polimi/MIT, Ossevatorio MIlano e Parque nacional de Pompei para observação de aplicação de uso de Drones. Solicitação sendo enviada à EACH.','ACH0636, ACH0151, ACH3778,','Tenho tratado com coordenadores de cursos EACH, dada acordos no processo de transferência à época com a diretoria da EACH, para que eu ministre disciplinas que associada à agenda de pesquisa. Foi feito acordo com curso de GPP que aquele curso teria alguma carga horária alocada na minha grade em 2023. Estas informações podem ser recuperadas com quem participou daquela reunião.',NULL,1),(3001908,'Luciano Vieira de Araújo',NULL,NULL,'T10P – Edifício A1','lvaraujo@usp.br','L.Araújo',2,0,NULL,NULL,NULL,NULL,1),(3010867,'Luciane Meneguin Ortega',NULL,NULL,'210C – Edifício A1','luciane.ortega@usp.br','L.Ortega',0,0,NULL,NULL,NULL,'Na segunda pela noite tenho aulas no MBA da EACH - Inovação e Empreendedorismo. Quinta e sexta noite também dou aulas no Mestrado de Empreendedorismo da FEA. Peço nao me colocarem em aulas noturnas no próximo semestre!',1),(3011643,'Violeta Sun',NULL,NULL,'110M – Edifício A1','violeta@usp.br','Violeta',0,0,NULL,'ACH2127-GTI','Preferência em ministrar aulas no período da manhã. ','Preferência em ministrar aulas no período da manhã',1),(3183372,'Daniel de Angelis Cordeiro',NULL,NULL,'352D – Edifício I1','daniel.cordeiro@usp.br','Daniel',0,4,NULL,NULL,'No 2º semestre, oferecerei a disciplina de pós SIN5005.',NULL,1),(3654493,'Fátima de Lourdes dos Santos Nunes Marques',NULL,NULL,'210P – Prédio A1','fatima.nunes@usp.br','Fátima',4,4,NULL,'Computação Gráfica','Respeitosamente peço à CoC para considerar alocar meus horários nas segundas ou terças-feiras. Motivo: estou atualmente coordenando o Escritório de Gestão de Indicadores de Desempenho Acadêmico (EGIDA) da Reitoria e fico em tempo integral na Cidade Universitária (Campus Butantã) de quarta a sexta-feira. Devido ao trânsito na cidade, é improdutivo fazer constantemente o deslocamento entre zona leste e zona oeste. ',NULL,1),(3800395,'Marcelo Morandini',NULL,NULL,'322E – Edifício I1','m.morandini@usp.br','M. Morandini',0,4,'Não tenho interesse ','ACH 2068, ACH 2028, ACH 2106','Problemas de saúde de meus sogros devem nos obrigar a ir para São José do Rio Preto com regularidade às 6as feiras ','Tenho problemas com familiares idosos em São José do Rio Preto e em muitos finais de semana preciso ir para lá. Por isso, a preferência por não ministrar aulas às 6as feiras',1),(4191053,'João Luiz Bernardes Junior',NULL,NULL,'110G – Edifício A','jlbernardes@usp.br','J.Bernardes',0,0,'Gostaria de requerer licença-prêmio no primeiro semestre','Computação Gráfica','Prefiro aulas no período noturno. Para o segundo semestre (e, caso a licença não seja aprovada, também para o primeiro), gostaria de não dar aulas às sextas-feiras (sempre dei aulas às sextas desde 2011, agora precisaria evitar, por motivos pessoais). Se eu pudesse dar aulas nas segundas e terças à noite seria o ideal!','Prefiro ministrar aulas no período noturno',1),(4348674,'Marcos Lordello Chaim',NULL,NULL,'322 N – Edifício I1','chaim@usp.br','Chaim',0,0,NULL,'ACH2087 -- Construção de Compiladores','Vou ministrar a disciplina Algoritmos e Estrutura de Dados na pós-graduação mas não sei se no primeiro ou no segundo semestre.',NULL,1),(4499300,'Cláudia Inés Garcia',NULL,NULL,'202 G – Prédio I1','claudiag@usp.br','Cláudia',0,0,'Pretendo pedir Licença-prêmio no segundo semestre.',NULL,'Peço para não dar aulas no último horário do noturno pelas dificuldades que enfrento para voltar a casa.','Não ministrar aulas no último horário do noturno, devido às dificuldade pra voltar a casa',1),(4770741,'Patrícia Rufino Oliveira',NULL,NULL,'proliveira@usp.br','322A – Edifício I1','P.Oliveira',0,4,NULL,NULL,NULL,NULL,1),(5060152,'Karina Valdivia Delgado',NULL,NULL,'104F – Edifício A1','kvd@usp.br','Karina',4,0,NULL,'ACH2107, ACH2137, ACH2108','Prefiro ministrar aula pela manhã ou tarde, se possível.','Se possível, gostaria de ministrar aulas pela manhã.',1),(5123804,'Sarajane Marques Peres',NULL,NULL,'320A – Edifício I1','sarajane@usp.br','Sarajane',0,4,'--','ACH2187	Mineração de Dados',NULL,NULL,1),(5846923,'José Ricardo Gonçalves de Mendonça',NULL,NULL,'345','jricardo@usp.br','J.Mendonça',0,0,'NÃO','ACH2128; ACH2177','Moro longe (72 km) da EACH, por isso seria muito, muito legal não pegar o 1o. horário das 8h00.','Prefiro dar aulas de tarde e à noite, se possível não na 5a.-feira por causa do rodízio de placa de meu carro.',1),(5847979,'Marcelo de Souza Lauretto',NULL,NULL,'104P – Edifício A1','marcelolauretto@usp.br','Lauretto',0,0,'Eu gostaria de usufruir de licença-prêmio no 2o semestre, se possível. ',NULL,'No 1o semestre pretendo ministrar a disciplina da pós graduação scx5017 introdução à ciênciade dados, vou preencher a planilha específica. ',NULL,1),(6342311,'Ariane Machado Lima',33579865,NULL,'210-N','ariane.machado@usp.br','Ariane',0,4,NULL,NULL,NULL,'Por favor, se possível gostaria de ministrar aulas no período da manhã.Obrigada.',1),(6422043,'Marcelo Medeiros Eler',NULL,NULL,'234','marceloeler@usp.br','M.Eler',4,0,NULL,'ACH2028, ACH2106','Tenho preferência por ministrar disciplinas no período da manhã e da tarde em razão de minha rotina familiar com duas crianças pequenas. Acrescento que pretendo propor uma disciplina optativa de \"Teste de Software\" para ser oferecida, se possível, no segundo semestre de 2023. ','Eu tenho preferência por ministrar aulas no período da manhã ou da tarde em razão da minha rotina familiar que envolve duas crianças pequenas.',1),(6428556,'André Cavalcanti Rocha Martins',NULL,NULL,'319 F – Prédio I1','amartins@usp.br','A.Calvalcanti',0,0,'Projeto senior PRINT Politécnico Milano aprovado para Março/23-Ago/23. Acordo realizado com Polimi/MIT, Ossevatorio MIlano e Parque nacional de Pompei para observação de aplicação de uso de Drones. Solicitação sendo enviada à EACH.','ACH0636, ACH0151, ACH3778, ','Tenho tratado com coordenadores de cursos EACH, dada acordos no processo de transferência à época com a diretoria da EACH, para que eu ministre disciplinas que associada à agenda de pesquisa. Foi feito acordo com curso de GPP que aquele curso teria alguma carga horária alocada na minha grade em 2023. Estas informações podem ser recuperadas com quem participou daquela reunião.',NULL,0),(6857908,'Alexandre Ferreira Ramos',NULL,NULL,'A1-104B','alex.ramos@usp.br','A. Ramos',0,0,NULL,NULL,NULL,'Como coordenador do CB tenho reuniões mensais da CoC e e da CG. Por isso peço não ter alocação de turmas às quintas. Se minha disciplina tiver duas aulas na semana, peço que os dias não sejam sextas e segundas, para garantir um intervalo mais homogêneo entre aulas. ',1),(7895418,'Marcelo Fantinato',NULL,NULL,'110I – Edifício A1','m.fantinato@usp.br','M. Fantinato',0,0,NULL,'ACH2067',NULL,NULL,1),(7896541,'Ana Amélia Benedito Silva',NULL,NULL,'356','anaAmelia@usp.br','Ana Amélia',0,0,NULL,'ACH2037','Prefiro não dar aulas manhã e noite do mesmo dia ou duas manhãs consecutivas às 8h00!','Não Selecionado',1),(8975412,'Luciano Antonio Digiampietri',NULL,NULL,'110P – Edifício A1','digiampietri@usp.br','L. Digiampietri',4,0,NULL,'ACH2197, ACH2107, ACH2108','Nos semestres ímpares costumo ministrar uma disciplina obrigatória no PPGSI, mas a atribuição de 2023 ainda não foi feita: http://ppgsi.each.usp.br/historico-de-oferencimento/','A preferência por não dar aula nas sextas não é nada muito importante. É mais importante eu não ter aulas nas quartas, por causa dos meus compromissos com a USP na PRPG.',1),(9475869,'Alexandre da Silva Freire',72492120,NULL,'não encontrado','samuel.bs66@usp.br','A.Freire',0,0,NULL,NULL,NULL,NULL,0);
